import React, { Component } from "react";
import { Link } from "react-router-dom";

class ContentCategory extends Component {
  render() {
    return (		
	<div class="col-md-3 col-lg-3 mb-4 text-center">
		<div class="product-entry border">
			<Link to="/productdetail" class="prod-img">
				<img src={props.imgurl1} class="img-fluid" alt="Free html5 bootstrap 4 template"/>
			</Link>
			<div class="desc">
				<h2><Link to="/productdetail">{props.item_name}</Link></h2>
				<span class="price">Rp.{props.price}</span>
			</div>
		</div>
	</div>				
    );
  }
}

export default ContentCategory;
